import { library } from "@fortawesome/fontawesome-svg-core";
import {
  faUser,
  faUserEdit,
  faUserCheck,
  faListAlt,
  faFileAlt,
  faFileDownload,
  faEdit,
} from "@fortawesome/free-solid-svg-icons";

library.add(
  faUser,
  faUserEdit,
  faUserCheck,
  faListAlt,
  faFileAlt,
  faFileDownload,
  faEdit
);
